import { Link } from "react-router-dom";

const EventsPage = () => {
  const EVENTS = [
    { id: 'e1', title: 'event 1' },
    { id: 'e2', title: 'event 2' },
    { id: 'e3', title: 'event 3' },
  ]

  return (
    <>
      <h1>Events Page</h1>
      <ul>
        {EVENTS.map(event => <li key={event.id}><Link to={event.id}></Link></li>)}
      </ul>
    </>
  )
}

export default EventsPage;
